import React from 'react';
import { loanTypeContext } from '../context';

const AddLoan = () => {
    const {loanTypes} = useContext(loanTypeContext);

    const optionElements = loanTypes.map((loanType)=><option value={loanType}>{loanType}</option>)


    return(
        <form>
            <input/>
            <input/>
            <select name="loan types">
                {optionElements}
            </select>
            <button>Add Loan Request</button>
        </form>
    ) 
}; 

export default AddLoan;
